  const [data, setData] = useState([]);
  
  useEffect(() => {
    axios
        .get('https://ghibliapi.herokuapp.com/films')
        .then((res) => {
            console.log(res.data);
            setData(res.data);
            
        })
        .catch((err) => {
            console.log(err);
        }); 
}, []);

